char int2char(int x) {
    char rv = 0;
    switch(x) {
        case 0:
            rv = '0';
            break;
        
        case 1:
            rv = '1';
            break;

        case 2:
            rv = '2';
            break;

        case 3:
            rv = '3';
            break;

        case 4:
            rv = '4';
            break;

        case 5:
            rv = '5';
            break; 

        case 6:
            rv = '6';
            break; 

        case 7:
            rv = '7';
            break; 

        case 8:
            rv = '8';
            break; 

        case 9:
            rv = '9';
            break;

        default:
            break;                                                                  
    }
    return rv;
}

void swap(char *a, char *b) {
    char t = *a;
    *a = *b;
    *b = t;
}

char *int2str(int x, char *a, int n) {
    int i = 0;
    int l, r;

    while(x) {
        a[i] = int2char(x%10);
        x = x/10;
        i++;
    }

    l = 0;
    r = i-1;
    a[i] = '\0';
    //reverse the str
    while (l < r) {
        swap(&a[l], &a[r]);
        l++;
        r--;
    }

    return a;
}

// Function to compress the string
int compress(char* a, int charsSize) {
    // TODO: Implement the string compression logic here.
    int count = 1;
    int i = 0;
    int j = 1;
    char curr_char = a[0];
    for (j; j < charsSize; j++) {
        if (a[j] != a[i]) {
            if (count > 1) {
                char nums[5] = {0};
                bzero(nums, 5);
                char *ptr = int2str(count, nums, 5);
                while(*ptr) {
                    i++;
                    a[i] = *ptr;
                    ptr++;
                }
            }
            i++;
            a[i] = a[j];
            count = 1;            
        } else {
            count++;
        }
    }

    if (count > 1) {
        char nums[5] = {0};
        bzero(nums, 5);
        char *ptr = int2str(count, nums, 5);
        while(*ptr) {
            i++;
            a[i] = *ptr;
            ptr++;
        }
    }

    return i+1; // Placeholder return value
}

